import TextInputComponent from "/components/TextInputComponent";

export default {
  title: "TextInputComponent",
  component: TextInputComponent,
};

export const Default = () => (
  <TextInputComponent
    value=""
    placeholder="Name your Trilobite:"
    state="default"
  />
);

export const Error = {
  args: {
    state: "error",
  },
};

export const Success = {
  args: {
    state: "success",
  },
};
